const Payment = ({...props}) => {
    console.log(props.data.id)
    if(props && props.data.id) {
        return (
            <>  
                <h1>Оплата {props.operatorName}</h1>
                    <form method="POST">
                        <label htmlFor="phone">Номер телефона</label>
                        <input name="phone" type="text"></input>
                        <label htmlFor="payment">Сумма платежа</label>
                        <input name="payment" type="text"></input>
                    </form>
            </>
        )
    } else {
        return <h1>404</h1>
    }
}

export default Payment
